/*
	建立測試使用的表格空間 (tablespace)
	
	DROP TABLESPACE STOCK_DATA;
	
	DROP TABLESPACE STOCK_INDEX;
	
	檢視表格空間 (tablespace)
	SELECT * FROM dba_data_files;
*/

-- -----------------------------------------
-- 資料準備：開始
-- -----------------------------------------

/* 建立表格空間 (tablespace) */
CREATE TABLESPACE STOCK_DATA
	DATAFILE '/u01/app/oracle/oradata/XE/stock_data.dbf'
	SIZE 5M;
	
CREATE TABLESPACE STOCK_INDEX
	DATAFILE '/u01/app/oracle/oradata/XE/stock_index.dbf'
	SIZE 1M;

/* 建立資料表物件 */	
CREATE TABLE SYSTEM.STOCKS
(
	NO			INT,
	SCHEMA			VARCHAR2(4),
	
	NAME			NVARCHAR2(50),
	ISIN			VARCHAR2(12),
	MARKET_DATE		DATE,
	MARKET_TYPE		NVARCHAR2(5),
	INDUSTRY		NVARCHAR2(10),
	CFICODE			VARCHAR2(6)
	
) TABLESPACE STOCK_DATA;

/* 加入 NOT NULL 條件限制 */
ALTER TABLE SYSTEM.STOCKS 
	ADD CONSTRAINT SYSTEM_STOCK_NO_NULL CHECK ("NO" IS NOT NULL);
	
ALTER TABLE SYSTEM.STOCKS
	ADD CONSTRAINT SYSTEM_STOCK_SCHEMA_NULL CHECK ("SCHEMA" IS NOT NULL);

/* 準備資料 */

COMMIT;
-- -----------------------------------------
-- 資料準備：結束
-- -----------------------------------------
